INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1, 110, 1, 101, 0, 105, 0.029, 1.5, 160, 0, 1, 122601);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (3, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0, 105, 2, 102, 0, 111, 0.014, 2.5, 120, 1, 2, 122401);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0, 110, 3, 103, 1, 105, 0.017, 2.5, 350, 0, 3, 122501);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (3, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0, 110, 4, 104, 0, 105, 0.016, 1.5, 130, 1, 4, 107501);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 1, 110, 5, 105, 0, 105, 0.014, 2.5, 160, 0, 5, 107601);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0, 120, 6, 106, 1, 103, 0.029, 3.5, 255, 0, 6, 107801);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 1, 120, 7, 107, 0, 103, 0.013, 3.5, 160, 0, 7, 110601);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0, 110, 8, 108, 1, 103, 0.014, 2.5, 350, 0, 8, 110401);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (3, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0, 105, 9, 109, 0, 100, 0.012, 1.5, 130, 1, 9, 110501);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 1, 105, 10, 110, 0, 103, 0.014, 2.5, 200, 0, 10, 115701);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0, 105, 11, 111, 1, 103, 0.071, 2.5, 350, 0, 11, 113601);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (3, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0, 120, 12, 112, 0, 103, 0.014, 1.5, 130, 1, 12, 107901);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 1, 110, 13, 113, 0, 105, 0.022, 1.5, 200, 0, 13, 108001);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 1, 110, 14, 114, 0, 108, 0.031, 2.5, 160, 0, 14, 110301);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0, 110, 15, 115, 0, 105, 0.036, 0.5, 130, 1, 15, 107701);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0, 110, 16, 116, 1, 95, 0.048, 3.5, 350, 0, 16, 113101);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (3, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0, 105, 17, 117, 0, 105, 0.043, 1.5, 130, 1, 17, 113301);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0, 105, 18, 118, 0, 95, 0.018, 1.5, 130, 1, 18, 113201);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 1, 110, 19, 119, 0, 108, 0.021, 2.5, 160, 0, 19, 117001);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0, 110, 20, 120, 1, 105, 0.036, 2.5, 255, 0, 20, 113501);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (3, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0, 105, 21, 121, 1, 105, 0.02, 2.5, 350, 0, 21, 113401);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0, 110, 22, 122, 0, 105, 0.018, 2.5, 130, 1, 22, 110101);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (3, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 1, 105, 23, 123, 0, 111, 0.03, 3.5, 160, 0, 23, 110001);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0, 110, 24, 124, 0, 103, 0.027, 1.5, 130, 1, 24, 117201);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 1, 105, 25, 125, 0, 108, 0.02, 3.5, 160, 0, 25, 117301);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (3, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0, 110, 26, 126, 1, 105, 0.04, 2.5, 350, 0, 26, 117401);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0, 110, 27, 127, 1, 105, 0.009, 3.5, 350, 0, 27, 117101);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0, 120, 28, 128, 1, 105, 0.022, 3.5, 255, 0, 28, 122901);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (3, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0, 110, 29, 129, 0, 105, 0.028, 2.5, 130, 1, 29, 122801);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 1, 105, 30, 130, 0, 108, 0.023, 3.5, 130, 0, 30, 122701);
